import * as React from 'react'

import { Box } from '@mui/system';
import { Button, Menu, MenuItem } from '@mui/material';

import {
  BrowserRouter as Router,
  Route,
  Routes,
  Outlet,
  useNavigate,
} from "react-router-dom";

import Home from "./pages/Home";
import Blogs from "./pages/Blogs";
import About from "./pages/About";

import './App.css'

const box = {
  borderRadius: 3,
  border: '1px outset white',
  boxShadow: '1px 2px 5px #cccccc',
  bgcolor: '#71818E',
};
const button = {
  fontSize: 17,
  p: '11px',
  m: 1,
  color: 'black',
  borderRadius: 3,
  bgcolor: '#bfbfbf',
}
function App() {
  return (
    <div style={{ textAlign: 'center' }}>
      <Router>
        <Routes>
          <Route path="/" element={<Layout />}>
            <Route index element={<Home />} />
            <Route path="/blogs" element={<Blogs />} />
            <Route path="/about" element={<About />} />
          </Route>
        </Routes>
      </Router>
    </div>
  );
}
const Layout = () => {
  //Top bsr with links

  const [anchorEl, setAnchorEl] = React.useState(null);
  const open = Boolean(anchorEl);
  const link = useNavigate();
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleClose = () => {
    setAnchorEl(null);
  }
  const toHome = () => {
    link('/');
  }
  const toAbout = () => {
    link('/about');
  }
  const toBlog = () => {
    link('/blogs')
  }
  return (
    <div>
      <Box component="section" sx={box}>
        <Button variant="contained" disableElevation sx={button} onClick={toHome}>Home</Button>
        <Button variant="contained" disableElevation sx={button} onClick={handleClick}>Blogs</Button>
        <Menu
          anchorEl={anchorEl}
          open={open}
          onClose={handleClose}
        >
          <MenuItem onClick={toBlog}>Blogs Page</MenuItem>
        </Menu>
        <Button variant="contained" disableElevation sx={button} onClick={toAbout}>About</Button>
      </Box>
      <Outlet />
    </div>

  )
};
export default App;
